import React from "react";

import s from "./Prisoner.module.css";

type Props = {
  img: any;
  time: number;
  name: string;
  university: string;
  course: number;
  text: string;
};

const Prisoner: React.FC<Props> = ({
  img,
  time,
  name,
  university,
  course,
  text,
}) => {
  return (
    <div className={s.container}>
        <div className={s.inner}>

      <div className={s.image} style={{ backgroundImage: `url(${img})` }} />
      <div className={s.sentence}>до {time} лет тюрьмы</div>
      <p className={s.name}>{name} </p>
      <p className={s.university}>
        {university}, {course} курс
      </p>
      <p className={s.text}>{text}</p>
        </div>
    </div>
  );
};

export default Prisoner;
